import React from "react";
import "../coinPage.css";

const Ind = props =>{
    return (
        <div className="indivcoin">
        <p>(icon) {props.name}  {props.symbol}</p>
        <p>Time</p>
        <p>Latest Price:</p>
        <p>{props.price_usd} {props.change}</p>
        <p>{props.price_btc}</p>
        <p>MarketCap: {props.marketcap}</p>
        <p>(24h)Volume: {props.volume}</p>
        <p>Current Supply: {props.total_supply}</p>
        <p>Total Supply: {props.max_supply}</p>
      </div>
    )
}


export default Ind;
